import React from "react";

const RepoItem = ({ repo }) => (
  <a
    href={repo.html_url}  key={repo.id} className="repoItemContainer" target="_blank" >
   
   <img class="img-thumbnail github-avatar" src="{{repo.avatar_url}}"></img>
      
    <table>
         
      <th>Name</th>
      <td> {repo.name}</td>
    </table>

  </a>

);

export default RepoItem;
